swaptrade_mid_dialog_desc_est_network_fe:
В кроссчейн-транзакциях эта комиссия включает в себя сетевые комиссии цепи платежного токена и кроссчейн-моста.

Комиссия за эту транзакцию выглядит следующим образом:
· сетевая комиссия цепи {chain}: {value1}
· сетевая комиссия моста {bridge}: {value2}

Сетевые комиссии выплачиваются майнерам и не взимаются нашей платформой.

swaptrade_intro_dialog_desc_cross_value_:
Разница в стоимости этой транзакции выглядит следующим образом:
· сетевая комиссия {chain}: {value1}
· комиссия моста {bridge}: {value2}

Если разница в стоимости значительно больше, а комиссии, указанные выше, относительно небольшие, это значит, что сумма свопа повлияла на глубину пула ликвидности этой пары токенов.

swaptrade_intro_tooltip_trade_including_:
При кроссчейн-обмене стоимость включает в себя сетевую комиссию платежной сети и часть комиссии за кроссчейн-мост. Разбивка комиссий по данной транзакции:
• Сетевая комиссия: {fromChainPriceAndFee}
• Комиссия за кроссчейн-мост: {bridgePriceAndFee}
Эти комиссии используются для покрытия расходов майнеров и не взимаются нашей платформой.

